import HomePage from "./pages/HomePage/HomePage";

// array of videos
const videodetails = videodata;

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Router>
          <Switch>
            <Route path="/" exact component={HomePage} />
          </Switch>
        </Router>
      </div>
    );
  }
}
